import React from "react";

const Selector = props => (
    <div className="dropdown">
        <a className="btn text-light" href="#" onClick={(e) => this.handleOption(e)}>open dropdown</a>
        <div className="dropdown-menu dropdown-menu-left dropdown-menu-arrow">
            <a className="dropdown-item" href="#">Atlanta, USA</a>
            <a className="dropdown-item" href="#">London, England</a>
            <a className="dropdown-item" href="#">Bujumbura, Burundi</a>
        </div>
    </div>
)

export default Selector;
